import React from "react";


class Weather extends React.Component{
    render(){
      return (
        <div>
        {this.prop.city}
        {this.prop.country}
        {this.prop.temperature}
        {this.prop.humidity}
        {this.prop.description}
        {this.prop.error}
        </div>
      );
    }
};

export default Weather;
